import Vue from "vue";
import VCalendar from "v-calendar";
import VueRouter from "vue-router";
import routes from "./routes";
Vue.use(VueRouter);
Vue.use(VCalendar, {});

// configure router
const router = new VueRouter({
  routes, // short for routes: routes
  linkActiveClass: "active",
});

export default router;
